import React from "react";
import ReactDOM from "react-dom";


function App() {
  return(
    <h1>Test</h1>
  )
}

// Render Method takes to parapemter (what, where)
ReactDOM.render(
  <div>
    <h1>Test</h1>
    <p>
      Lorem ipsum dolor sit amet consectetur adipisicing elit. Officia natus non
      id error dolori
    </p>
    <ul>
      <li>One</li>
      <li>Two</li>
      <li>Three</li>
    </ul>
  </div>,
  document.getElementById("root")
);
